class FITSHighLevelTableBenchmarks:
    def time_read_nommap(self):
        self.table_bytes.seek(0)
        try:
            Table.read(self.table_bytes, format='fits', memmap=False)
        except TypeError:
            Table.read(self.table_bytes, format='fits')

